import React, { useState, useEffect } from 'react';

const PrescriptionModal = ({ show, onClose, onSave, prescriptionItem }) => {
  const [formData, setFormData] = useState({
    medication: '',
    dosage: '',
    frequency: '',
    startDate: '',
    endDate: '',
    notes: ''
  });

  const [errors, setErrors] = useState({});

  useEffect(() => {
    if (prescriptionItem) {
      setFormData({
        medication: prescriptionItem.medication || '',
        dosage: prescriptionItem.dosage || '',
        frequency: prescriptionItem.frequency || '',
        startDate: prescriptionItem.startDate ? prescriptionItem.startDate.substring(0, 10) : '',
        endDate: prescriptionItem.endDate ? prescriptionItem.endDate.substring(0, 10) : '',
        notes: prescriptionItem.notes || ''
      });
    } else {
      setFormData({
        medication: '',
        dosage: '',
        frequency: '',
        startDate: '',
        endDate: '',
        notes: ''
      });
    }
    setErrors({});
  }, [prescriptionItem, show]);

  if (!show) return null;

  const validate = () => {
    const newErrors = {};
    if (!formData.medication.trim()) newErrors.medication = 'Medication name is required';
    if (!formData.dosage.trim()) newErrors.dosage = 'Dosage is required';
    if (!formData.frequency.trim()) newErrors.frequency = 'Frequency is required';
    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleChange = e => {
    const { id, value } = e.target;
    setFormData(prev => ({ ...prev, [id]: value }));
  };

  const handleSubmit = e => {
    e.preventDefault();
    if (!validate()) return;
    onSave(formData);
    onClose();
  };

  return (
    <div className="modal d-block" tabIndex="-1" style={{ backgroundColor: 'rgba(0,0,0,0.5)' }}>
      <div className="modal-dialog" role="document" onClick={e => e.stopPropagation()}>
        <div className="modal-content">
          <div className="modal-header">
            <h5 className="modal-title">{prescriptionItem ? 'Edit Prescription' : 'Add Prescription'}</h5>
            <button type="button" className="btn-close" onClick={onClose}></button>
          </div>
          <form onSubmit={handleSubmit} noValidate>
            <div className="modal-body">
              <div className="mb-3">
                <label htmlFor="medication" className="form-label">Medication Name*</label>
                <input
                  type="text"
                  className={`form-control ${errors.medication ? 'is-invalid' : ''}`}
                  id="medication"
                  value={formData.medication}
                  onChange={handleChange}
                  required
                />
                <div className="invalid-feedback">{errors.medication}</div>
              </div>

              <div className="row mb-3">
                <div className="col">
                  <label htmlFor="dosage" className="form-label">Dosage*</label>
                  <input
                    type="text"
                    className={`form-control ${errors.dosage ? 'is-invalid' : ''}`}
                    id="dosage"
                    value={formData.dosage}
                    onChange={handleChange}
                    required
                  />
                  <div className="invalid-feedback">{errors.dosage}</div>
                </div>
                <div className="col">
                  <label htmlFor="frequency" className="form-label">Frequency*</label>
                  <input
                    type="text"
                    className={`form-control ${errors.frequency ? 'is-invalid' : ''}`}
                    id="frequency"
                    value={formData.frequency}
                    onChange={handleChange}
                    required
                  />
                  <div className="invalid-feedback">{errors.frequency}</div>
                </div>
              </div>

              <div className="row mb-3">
                <div className="col">
                  <label htmlFor="startDate" className="form-label">Start Date*</label>
                  <input
                    type="date"
                    className="form-control"
                    id="startDate"
                    value={formData.startDate}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="col">
                  <label htmlFor="endDate" className="form-label">End Date*</label>
                  <input
                    type="date"
                    className="form-control"
                    id="endDate"
                    value={formData.endDate}
                    onChange={handleChange}
                    required
                  />
                </div>
              </div>

              <div className="mb-3">
                <label htmlFor="notes" className="form-label">Notes</label>
                <textarea
                  className="form-control"
                  id="notes"
                  rows="3"
                  value={formData.notes}
                  onChange={handleChange}
                />
              </div>
            </div>

            <div className="modal-footer">
              <button type="button" className="btn btn-secondary" onClick={onClose}>Cancel</button>
              <button type="submit" className="btn btn-primary">{prescriptionItem ? 'Update' : 'Save'}</button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default PrescriptionModal;
